import "./video.css";

function Video({ title, channel, views, time, verified}) {
  var verifiedChannel = <div className="channel">{channel}✔️</div>;
  var unverifiedChannel = <div className="channel">{channel}</div>;
  return (
    <>
      <div className="container">
        <div className="pic">
          <img
            alt="sample"
            src="https://www.simplilearn.com/ice9/free_resources_article_thumb/what_is_image_Processing.jpg"
          ></img>
        </div>
        <div className="title">{title} Video</div>
        {verified ? verifiedChannel : unverifiedChannel}
        {/* <div className="channel">{channel}</div> */}
        <div className="views">
          {views} Views <span>.</span>
          {time}
        </div>
      </div>
    </>
  );
}

export default Video;
